import React from "react";
import Post from "./Post";

async function fetchPosts() {
  let posts = await fetch('https://listnotes.forgiveandforget.workers.dev/').then(result => result.data);
  console.log("from list ",posts)
  return posts.json()
}

function List() {
  let sposts = fetchPosts();
  return (
    <ul contentEditable="true" spellCheck="false">
      posts.map(<Post />)
    </ul>
  );
}

export default List;
